const BlogNavigation = () => (
  <nav className="flex flex-col justify-between">
    <div>
      <div className={styles.heroImg} />
      <a></a>
    </div>
    <div>
      <ul>
        <li>hello</li>
      </ul>
    </div>
  </nav>
);

export default BlogNavigation;
